function CoolCounter(){
    let count = 0

    const increaseCount = () => {
        count++
        //h1s textcontent = count
        console.log(`increased to ${count}`)
    }
    const decreaseCount = () => {
        count--
        console.log(`decreased to ${count}`)

    }
    return (
        <div>
           <h1>{count}</h1>
           <button onClick={decreaseCount}>Decrease</button>
           <button onClick={increaseCount}>Increase</button>
        </div>
    )
}

export default CoolCounter
